INSERT INTO `articles` (`PostID`, `Author`, `Subject`, `Content`, `Date`) VALUES
(1, 'Yusk8', 'Welcome', 'Welcome to Armagedom Worlds V2 I hope you enjoy the new server we''re still improving it so if you have any problems or missing thing soon we will fix.\r\n<br><br>\r\nPS - The first Redeem Code is FirstPlayers it will be valid until 08/08 hope you enjoy', '2016-07-08 16:38:00'),
(2, 'Yusk8', 'First Event', 'Guys for those who have not seen a new event on the server the join is FirstEvent hope you like it because one of the items for this event will give a large reward in the event of Christmas.', '2016-07-20 23:40:00'),
(3, 'Yusk8', 'LQS Event', 'Guys now on Saturday we will have a new Limited Quantity Shop instead of the Limited Beta Shop Recalling that these items will become rare for that try to take advantage of this shop the limit is 200 of each item and they will not be renewed or is if they can''t get until they didn''t on these items', '2016-07-20 23:44:00'),
(4, 'Yusk8', 'Trade Coins', 'Guys I just added the purchase system of Trade Coins for now is only by PagSeguro but later on I will add other purchase methods.', '2016-07-21 21:24:00');
INSERT INTO `classes` (`ItemID`, `Category`, `Description`, `ManaRegenerationMethods`, `StatsDescription`) VALUES
(0, '', '', '', ''),
(2, 'M1', 'Warriors are quintessential melee fighters. Simple, direct, and effective, they are masters of armed combat, and quite durable.', 'Warriors gain mana when they:,-Strike an enemy in combat (more effective on crits),-Are struck by an enemy in combat', 'Warriors are quintessential melee fighters. Simple, direct, and effective, they are masters of armed'),
(3, 'C1', 'Mages are the quintessential magic user. They attack from a distance, able to cause great harm or restrict a target''s actions.', 'Mages gain mana from all hits landed in combat, and especially on crits.  The amount depends on damage relative to *their own* HP total.', 'Mages are the quintessential magic user. They attack from a distance, able to cause great harm or re'),
(4, 'M3', 'Ninjas operate in silence secrecy. They are capable fighters, but prefer to attack quickly and decisively, eliminating the threat of resistance.', 'Ninjas gain mana when they:,-Land the first strike in combat,-Strike an enemy in combat (more effective on crits),-Cast "Shadowburn" on a target without "Shadowblade"', 'Ninjas operate in silence secrecy. They are capable fighters, but prefer to attack quickly and decis'),
(5, 'M1', 'Berserkers are crazed, intensely powerful fighters. they fear nothing, least of all death, and are known to become even more dangerous when wounded.', 'Beta Beserkers gain mana when they:,-Strike an enemy in combat (more effective on crits),-Are struck by an enemy in combat', 'Berserkers are crazed, intensely powerful fighters. they fear nothing, least of all death, and are k'),
(6, 'M2', 'Alpha Pirates are quick-moving, deadly fighters. They prey on any weakness in their opponent, while using poisons and evasive footwork to their advantage.', 'Alpha Pirates gain mana when they:,-Strike an enemy in combat (more effective on crits),-Dodge any attack (restores HP as well)', 'Alpha Pirates favor Dexterity and Strength'),
(378, 'C1', 'Almonds of Yoshino are the most powerful monsters in any battle, no one has managed to beat them yet.', 'V.I.P. of Yoshino regain mana through two of their abilities:\\r","-Strike using Melee Attacks.', 'Favors Strength.'),
(975, 'C1', 'Healers are servants of good who use their powers to aid the sick, weak, and injured. Their powerful healing magic is often the difference between a groups victory or doom.', 'Healers regain mana through two of their abilities:\\r","-When \\"Healing Word\\" is cast on a friendly target, any damage taken by that target returns mana to the Healer\\r","-When \\"Energy Flow\\" is cast on a hostile target, any strike that lands on this target returns mana to the Healer', 'Acolytes are passionately devoted to improving the condition of the world around them. They are perh'),
(1274, 'M1', 'DoomLord will rule the earth!', 'DoomLord regain mana through two of their abilities:\\r","-When \\"Healing Word\\" is cast on a friendly target, any damage taken by that target returns mana to the Healer\\r","-When \\"Energy Flow\\" is cast on a hostile target, any strike that lands on this target returns mana to the Healer', 'Favors Strength.'),
(1275, 'M1', 'This clan of ninjas have deadly speed and skills that will turn around the battle in warfare. A master mystic ninja unlocks the full potential of the class.', 'A master mystic ninja specializes in:,-PvP Combat,-Dodging attacks,-Speedy attacks', 'Master Mystic Ninja favors Dexterity and Luck.'),
(1535, 'M1', 'The masters of Smithing and Merging.', 'Black Smith gain mana when they:,-Strike an enemy in combat (more effective on crits),-Dodge any attack (restores HP as well)', 'Blacksmith favor Strength'),
(37181, 'M1', 'Starlords are quick and dangerous, capable of engaging mutliple enemies at range', 'StarLords gain mana when they:,-Strike an enemy in combat (more effective on crits),-Dodge any attack (Restores HP as well).', 'Starlord favor Dexterity and Strength'),
(37193, 'M3', 'A Vindicator Of They is a powerful magical warrior using skills named after They Might Be Giants songs and lyrics. Best for solo battles.', 'Vindicators Of They gain mana when they:,-Strike an enemy in combat (more effective on crits),-Are struck by an enemy whilst in combat', 'Vindicators of They favors Strength, Intellect, and Endurance'),
(94900, 'M2', 'You are the God Of Lore, when you where this Class.', 'God have very high mana consumption:,Skills have very high mana consumption,Higher damage compensates mana', 'God favors Strength, Intellect, and Endurance'),
(100089, 'S1', 'Archers are quick-moving, deadly fighters. They prey on any weakness in their opponent, while using poisons and evasive footwork to their advantage.', 'Archers gain mana when they:,-Strike an enemy in combat (more effective on crits),-Are struck by an enemy in combat', 'Archers favor Strength, Endurance, and Dexterity'),
(100092, 'C2', 'A Wizard is a powerful magical warrior using skills. Best for solo battles.', 'Wizards gain mana from all hits landed in combat, and especially on crits.  The amount depends on damage relative to *their own* HP total.', 'Wizards are the quintessential magic user. They attack from a distance.'),
(100227, 'M2', 'This clan of ninjas have deadly speed and skills that will turn around the battle in warfare.', 'Good at:,-PvP Combat,-Critical Attacks,-Dodging attacks,-Item Hunting', 'Favors dexterity and luck.'),
(200290, 'M3', 'Black Knights are quintessential melee fighters. Simple, direct, and effective, they are masters of armed combat, and quite durable.', 'Black Knight gain mana when they:,-Strike an enemy in combat (more effective on crits),-Are struck by an enemy in combat', 'Dark Lords favor Intellect.'),
(200291, 'M1', 'Tester of Yoshino are the Testers of Yoshino in V.I.P. of Yoshino Class.', 'Tester of Yoshino gain mana when they:,-Strike an enemy in combat (more effective on crits),-Are struck by an enemy in combat', 'Favors Intellect.'),
(200297, 'C2', 'Crusaders are quick and dangerous, capable of engaging mutliple enemies at melee.', 'Crusaders gain mana when they:,-Strike an enemy in combat (more effective on crits),-Are struck by an enemy in combat', 'Crusaders are crazed, intensely powerful fighters. they fear nothing, least of all death, and are k'),
(200315, 'C3', 'Knights are quick and dangerous, capable of engaging mutliple enemies at melee.', 'Knights gain mana when they:,-Strike an enemy in combat (more effective on crits),-Are struck by an enemy in combat', 'Knights favor Strength, Endurance, and Dexterity'),
(200319, 'M3', 'Assassin''s are quick and dangerous, capable of engaging mutliple enemies at melee.', 'Assassin''s gain mana when they:,-Strike an enemy in combat (more effective on crits),-Are struck by an enemy in combat', 'Assassin favor Dexterity and Intellect'),
(200335, 'C2', 'A Sage is a powerful magical warrior using skills. Best for solo battles.', 'Sages gain mana when they:,-Strike an enemy in combat while under the effect of Tidal Strike', 'Sage are the quintessential magic user. They attack from a distance.'),
(200336, 'C3', 'Priest are servants of good who use their powers to aid the sick, weak, and injured. Their powerful healing magic is often the difference between a groups victory or doom.', 'Priest regain mana through two of their abilities:\\r","-When \\"Healing Word\\" is cast on a friendly target, any damage taken by that target returns mana to the Healer\\r","-When \\"Energy Flow\\" is cast on a hostile target, any strike that lands on this target returns mana to the Healer', 'Priest are passionately devoted to improving the condition of the world around them. They are perh'),
(200382, 'C2', 'A Wizard is a powerful magical warrior using skills. Best for solo battles.', 'Wizards gain mana from all hits landed in combat, and especially on crits.  The amount depends on damage relative to *their own* HP total.', 'Wizards are the quintessential magic user. They attack from a distance.'),
(200477, 'M1', 'Runacle are strong healers and can see into everyone''s future, past and present, even if they don''t know it! They are excellent at maintaining the health and status of their friends. They can also notify their friends of their opponents weaknesses and strengths, making them the perfect ones to accept a party invite from.', 'Runacle gain mana when they:\\r","-all hits landed in combat, and especially on critical hits. The amount depends on damage relative to *their own* HP total.\r\nSkills:', 'Runacle favors Intellect.'),
