(200536, 'M3', 'They Might be a Mod alter the flow of time to tremendous effect in battle', 'They Might be a Mod gain mana when they:\\r","-Attack while under the effects of Temporal Rift.', 'They Might be a Mod favor Strength, Dexterity, and Intellect.'),
