(200775, 'M2', 'The Thunderbergs were always known as fast as a lightning so they became one with lightning giving them shocking horrors and thus the name thunder, thunderbergs', '"Thunderbergs are good in:","-PvP Combat","-Critical Attacks","-Dodging attacks","-Item Hunting\\""', 'ThunderBurgs are good with the Brave Enhancements.'),
