(2008452, 'C3', 'BloodElven alter the flow of time to tremendous effect in battle', 'BloodElven gain mana when they:\\r","-Attack while under the effects of the Secret Skill "Press the 6 in your Keyboard".', 'BloodElven favor Strength, Dexterity, and Intellect.'),
