(2008900, 'S1', 'Monks are servants of good who use their powers to aid the sick, weak, and injured. Their powerful healing magic is often the difference between a groups victory or doom. They Protect all the Natures in Lore.', 'Monks regain mana through two of their abilities:\\r","-When \\"Call Spirit\\" is cast on a friendly target, any damage taken by that target returns mana to the Healer\\r","-When \\"Asura Strike\\" is cast on a hostile target, any strike that lands on this target returns mana to the Healer', 'Monks are the masters of Nature.'),
